var userLinePoints = []  //用户添加的线
function addTrackPoints(ret){ //添加轨迹点信息
    var str = $('#trackPoints').val()
    if(ret){ str = ret}
    if(str == ''){
        alert('请输入轨迹回放坐标点')
        return
    }

    var trackPoints = $.parseJSON(str);
    console.log(trackPoints)

    userLinePoints = []

    var data = [];
    let d = -1;
    var tmparr = [];
    var linestyles = [];
    for(var i in trackPoints){
        linestyles[linestyles.length] = new Careland.LineStyle({color:getColor(),selectedColor:'#DDA0DD',size:5,selectedSize:5});
        data[i] = []
        for(var j in trackPoints[i]){
            var tmp = trackPoints[i][j]
            data[i][j] = {};
            data[i][j].Point = new Careland.Point(tmp.x,tmp.y);
            userLinePoints.push(data[i][j].Point)
            data[i][j].Text = {value:tmp.text,textOffsetX:-100,textOffsetY:-40,fontSize:15,fontColor:'#e91e63',fontBold:true,textWidth:200,textAlign:'center'};
            data[i][j].Icon = {src:"//mapapi.careland.com.cn/images/truck/run_1.png",offsetX:-20,offsetY:-20};
            data[i][j].Alarm = {value:tmp.text}
            data[i][j].Time = tmp.time
        }
    }

    trackData = data
    console.log(trackData)
    trackHandler.clear()
    trackHandler.setDefaultStyles({trackLineStyles:linestyles})
    trackHandler.init(trackData);
    trackHandler.setSpeed($('#trackSpeed').val());
    console.log('get data end')
}

        var polyline = new Careland.Polyline();  							   //创建折线

        polyline.setStyle(new Careland.LineStyle({color:'red',size:6,opacity:40}));		//设置折线的样式
        userLineLayer.add(polyline);														//将折线加到图层上
    }else{
        userLineLayer.clear()
        userLineLayer = null
    }
}
var getColorIndex = 1
function getColor(){
    if(getColorIndex == 1){
        getColorIndex = 0
        return '#0000FF'
    }
    getColorIndex = 1
    return '#1E90FF'

    var a,b = [],c="#" ;
    for(var i=0;i<6;i++){
        a = Math.ceil( Math.random()*16).toString(16).toLocaleUpperCase();
        b[i] = a;
        c += b[i];
    }
    c = c.substr(0,7)
    return c
}

}

function uidDrivingRouteDown(){
    if($('#trackUidCeil').val()){
        option.wp = JSON.parse($('#trackUidCeil').val())
    }
    if(!start){
        alert('起点不能为空')
        return
    }
    if(!end){
        alert('终点不能为空')
        return
    }
    Driving.getDrivingRouteData(function(data){
        console.log(data)
        var aLink = document.createElement('a');
        //var content = "111";
        var blob = new Blob([data]);
        var evt = document.createEvent("HTMLEvents");
        evt.initEvent("click", false, false);//initEvent 不加后两个参数在FF下会报错, 感谢 Barret Lee 的反馈
        var myDate = new Date();

        aLink.download = "cldDRData"+ myDate.getFullYear()+ myDate.getMonth()+myDate.getDate()+myDate.getHours()+myDate.getMinutes()+myDate.getSeconds()+ ".cld";
        aLink.href = URL.createObjectURL(blob);
        aLink.dispatchEvent(evt);
        aLink.click();
    });
}

function carelandtogcpoint(){
    var point1 = $('#carelandtogcpoint').val()
    if(!point1){
        $('#carelandtogcpointend').val('坐标不能为空')
        return
    }
    point1 = point1.split(',')
    point1[0] = point1[0].trim()
    point1[1] = point1[1].trim()
    if(!point1[0] || !point1[1] ){
        $('#carelandtogcpointend').val('坐标错误')
        return
    }
    var point2 = Careland.DrawTool.KldPointToGbPoint(point1[0],point1[1]);//(lng,lat)
    //console.log(point);//{x: 411003956, y: 81459103}
    $('#carelandtogcpointend').val(point2.lng+","+point2.lat)
    //console.log(point1);
}
